import Grid from "@mui/material/Grid";
import Button from "@mui/material/Button";
const Pricing = () => {
  return (
    <>
      <Grid container spacing={1}>
        <Grid item xs={4} />
        <Grid item xs={2}>
          <Button variant="contained" sx={{ backgroundColor: "black" }}>
            Free
          </Button>
        </Grid>
        <Grid item xs={3}>
          Individual
        </Grid>
        <Grid item xs={3}>
          Team
        </Grid>
      </Grid>
    </>
  );
};
export default Pricing;
